const hamburger=()=>{const e=document.querySelector(".hamburger-menu"),a=document.querySelector(".navbar_list_mobile"),r=document.querySelector(".navbar_wrapper");e.addEventListener("click",()=>{e.classList.toggle("hamburger-menu_active"),a.classList.toggle("navbar_active"),r.classList.toggle("navbar_wrapper_active")}),r.addEventListener("click",()=>{e.classList.toggle("hamburger-menu_active"),a.classList.toggle("navbar_active"),r.classList.remove("navbar_wrapper_active")})};export{hamburger};